One pouch preferred oatmeal
1/2 bottle of peaches and cream premier protein(or preferred flavor)
Approx 100-150 grams liquid egg white
Approx 50 grams blueberries

I make the package of oatmeal exactly how the instructions say. Once the oatmeal is nice and thick, I add the half bottle of my peach premier protein shake. I then microwave for a couple of minutes stirring often. Once that has thickened some I slowly add in the egg whites, stirring quickly. Finally add the blueberries. I microwave another minute or two stirring often.

This turns out so nice and creamy! It is a huge portion, it ends up being about a pound of food. 
  I do feel like maybe I have a step or two more than necessary, but this turns out perfect, so I don’t do anything different.

Macros
Calories 310.7
Protein 31.8 grams
Carbs 36 grams
